import React from 'react';
import Button from '@material-ui/core/Button';
import AddIcon from '@material-ui/icons/Add';

const Form = () => {
    return(
        <>
            <div className="container">
                <div className="row d-flex justify-content-center">
                <div class="card col-4 mt-2">
                    <form className="card-body">
                    <div class="mb-3">                
                        <input type="text" class="form-control" id="title" placeholder="Title" aria-describedby="emailHelp" />
                    </div>
                    <div class="">
                        <textarea class="form-control" placeholder="Content" id="floatingTextarea"></textarea>
                    </div>
                    <Button type="button" class="btn btn_Add btn-sm btn-default"><AddIcon /></Button>
                    </form>
                </div>
                </div>
            </div>
        </>
    )
}
export default Form;
